function Loader() {
  return (
    <div>
      <p>Hello world</p>
      <img className="loader" src="/img/logo-simple.png" alt="loader" />
      <style jsx>{`
        .loader {
          display: inline-block;
          position: relative;
          width: 80px;
          height: 80px;
          animation: loader s infinite;
        }

        @keyframes loader {
          0% {
            transform: rotate(0);
          }
          50% {
            transform: rotate(900deg);
          }
          100% {
            transform: rotate(1800deg);
          }
        }
      `}</style>
    </div>
  );
}

export default Loader;
